import React, { useState } from 'react';

export default function Card (props) {
    const [listofTodos] = useState({});
    return (
        <div>
            {listofTodos.props.map(todo => {
                return (
                    <ul>
                        <li>{todo.content}</li>
                    </ul>
                )
            })}
        </div>
    );
}
